INSERT INTO `produto` (`id`, `id_fornecedor_principal`, `tipo_produto`, `referencia`, `nome`, `nome_comercial`, `trabalha_com_lote`, `possui_grade`, `importado`, `eh_medicamento`, `eh_vacina`, `peso_bruto`, `peso_liquido`, `quantidade_compra`, `estoque_minimo`, `estoque_maximo`, `quantidade_etiquetas`, `tem_conversao`, `observacoes`, `id_medicamento_generico`, `id_medicamento_principioativo`, `id_medicamento_grupo`, `id_especie_vacina`, `quantidade_dias_validade`, `quantidade_doses`, `quantidade_dias_entre_doses`, `data_cadastro`, `data_ultalt`, `status`, `foto_capa`, `id_marca`) VALUES
(1, 2, 'C', '', 'Maxicam Plus 0,5mg', 'Maxicam Plus 0,5mg', 1, 0, 0, 1, 0, '0.000', '0.000', '1.00', '0.00', '0.00', 0, 0, 'Maxicam Plus\r\n\r\nÉ uma associação de um antiinflamatório não esteróide com atividade inibidora seletiva da cicloxigenase-2 (cox-2) - o Meloxicam - com um condroprotetor com atividade reparadora de tecidos ósseos e cartilaginosos - o Sulfato de Condroitina A.\r\n\r\nO bloqueio seletivo da cox-2 proporcionado pelo Meloxicam confere atividade antiinflamatória, analgésica e antiexsudativa com mínimos efeitos gastrolesivos ou ulcerogênicos, inibe ainda a infiltração de leucócitos no tecido inflamado e previne a destruição óssea e cartilaginosa que ocorre nos processos degenerativos ósseos e cartilaginosos.\r\n\r\nO Sulfato de Condroitina A é um importante componente natural de a cartilagem articular, responsável por manter a integridade fisiológica e funcional do tecido cartilaginoso e do fluido sinovial, devolvendo a mobilidade articular. Neutraliza enzimas que são produzidas pela cartilagem lesionada e que aumentam a degeneração do tecido cartilaginoso.\r\n\r\nPromove a reparação do fluido sinovial e do tecido cartilaginoso e ósseo graças a sua capacidade de estimular a biossíntese de proteoglicanos e colágeno.\r\n\r\nContribui para o alívio da dor, redução do processo inflamatório e regeneração do tecido articular, acelerando o processo de cura.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:17:28', '2017-03-14 14:34:00', 1, '20170313222217.jpg', 1),
(2, 2, 'C', '', 'Maxicam Plus 2,0mg', 'Maxicam Plus 2,0mg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Maxicam Plus\r\n\r\nÉ uma associação de um antiinflamatório não esteróide com atividade inibidora seletiva da cicloxigenase-2 (cox-2) - o Meloxicam - com um condroprotetor com atividade reparadora de tecidos ósseos e cartilaginosos - o Sulfato de Condroitina A.\r\n\r\nO bloqueio seletivo da cox-2 proporcionado pelo Meloxicam confere atividade antiinflamatória, analgésica e antiexsudativa com mínimos efeitos gastrolesivos ou ulcerogênicos, inibe ainda a infiltração de leucócitos no tecido inflamado e previne a destruição óssea e cartilaginosa que ocorre nos processos degenerativos ósseos e cartilaginosos.\r\n\r\nO Sulfato de Condroitina A é um importante componente natural de a cartilagem articular, responsável por manter a integridade fisiológica e funcional do tecido cartilaginoso e do fluido sinovial, devolvendo a mobilidade articular. Neutraliza enzimas que são produzidas pela cartilagem lesionada e que aumentam a degeneração do tecido cartilaginoso.\r\n\r\nPromove a reparação do fluido sinovial e do tecido cartilaginoso e ósseo graças a sua capacidade de estimular a biossíntese de proteoglicanos e colágeno.\r\n\r\nContribui para o alívio da dor, redução do processo inflamatório e regeneração do tecido articular, acelerando o processo de cura.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:20:31', '2017-03-13 22:20:31', 1, '20170313222442.jpg', 1),
(3, 2, 'C', '', 'Capstar 11 mg - Até 11 Kg', 'Capstar 11 mg - Até 11 Kg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, '- É indicado em todos os casos em que se deseja uma rápida e segura eliminação das pulgas adultas;\r\n- Consulte sempre o médico Veterinário de sua confiança para o uso apropriado deste medicamento.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:21:59', '2017-03-13 22:23:11', 1, '20170313222722.jpg', 0),
(4, 2, 'C', '', 'Capstar 57 mg - 11 a 57 Kg', 'Capstar 57 mg - 11 a 57 Kg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, '- É um adulticida indicado para o controle de pulgas, que oferece rápido knock-down, associado a um conveniente modo de usar, a via oral;', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:25:32', '2017-03-13 22:25:56', 1, '20170313223007.jpg', 0),
(5, 2, 'C', '', 'Doxiciclina 200mg', 'Doxiciclina 200mg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Doxiciclina. \r\n\r\nIndicações: \r\nMicrorganismos Gram-negativos, Gram-positivos, Chlamydia, Mycoplasma, Actinomyces, Brucella, erliquiose, febre maculosa, babesiose, bartonelose, micoplasmose hemotrópica felina (antiga hemobartonelose), borreliose (doença de Lyme), leptospirose, infecções respiratórias, genitourinárias, articulares, gastroenterites infecciosas, piodermites, feridas infectadas, pós-operatórios, otites e infecções causadas por alguns protozoários. \r\n\r\nCaracterísticas e Benefícios: \r\n\r\nA doxiciclina é um antimicrobiano de amplo espectro, tendo absorção oral rápida e elevada, com ação 1 a 3 horas após a ingestão. É o antibiótico de escolha para o tratamento de doenças transmitidas por carrapatos em cães e alguns agentes infecciosos importantes em gatos. Os comprimidos de Doxitrat são palatáveis e sulcados para facilitar sua administração. ', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:27:40', '2017-04-02 13:47:32', 1, '20170313223152.jpg', 0),
(6, 2, 'C', '', 'Doxiciclina80 mg', 'Doxiciclina80 mg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Doxiciclina. \r\n\r\nIndicações: \r\n\r\nMicrorganismos Gram-negativos, Gram-positivos, Chlamydia, Mycoplasma, Actinomyces, Brucella, erliquiose, febre maculosa, babesiose, bartonelose, micoplasmose hemotrópica felina (antiga hemobartonelose), borreliose (doença de Lyme), leptospirose, infecções respiratórias, genitourinárias, articulares, gastroenterites infecciosas, piodermites, feridas infectadas, pós-operatórios, otites e infecções causadas por alguns protozoários. \r\n\r\nCaracterísticas e Benefícios: \r\n\r\nA doxiciclina é um antimicrobiano de amplo espectro, tendo absorção oral rápida e elevada, com ação 1 a 3 horas após a ingestão. É o antibiótico de escolha para o tratamento de doenças transmitidas por carrapatos em cães e alguns agentes infecciosos importantes em gatos. Os comprimidos de Doxitrat são palatáveis e sulcados para facilitar sua administração. ', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:29:00', '2017-04-02 13:57:55', 0, '20170313223326.jpg', 0),
(7, 2, 'C', '', 'Doxiciclina Injetável frasco 20 ml', 'Doxiciclina Injetável frasco 20 ml', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'DESCRIÇÃO DO PRODUTO\r\nA Doxiciclina é um antibiótico da família das tetraciclinas, diferenciada por ser mais lipofílica que as demais drogas desta família, o que garante ótima distribuição e maior penetração nos fluidos e tecidos orgânicos, permitindo redução do número de dosagens diárias necessárias.\r\n\r\nA Doxiciclina também possui maior capacidade de ligação a proteínas plasmáticas, o que prolonga a meia-vida da droga. A eliminação da droga ocorre através das fezes, como conjugado ou quelado inativo. Possui atividade bacteriostática de amplo espectro. Possui atividade contra bactérias gram + e -, além de micoplasmas, espiroquetas, clamídias e riquétsias.\r\n\r\nPROPRIEDADES\r\nMolécula semi-sintética, derivada de Streptomyces spp. É 5 a 10 vezes mais lipofílica que outras tetraciclinas, ou seja, possui maior facilidade em se distribuir pelos tecidos corporais, atingindo concentrações efetivas na maioria dos tecidos.\r\n\r\nINDICAÇÃO DO PRODUTO\r\nDoxiciclina Vetnil Solução Injetável é indicada para tratamento de enfermidades infecciosas de cães causadas por agentes etiológicos sensíveis a Doxiciclina, tais como: Erliquiose canina: Ehrlichia canis. Febre maculosa (Rocky Mountain Spotted-Fever) causada por Rickettsia rickettsii. Borreliose ou Doença de Lyme: Borrelia burgdoferi. Hemobartonelose: Haemobartonella canis. Infecções respiratórias causadas por Staphylococcus spp, Streptococcus spp, Bordetella bronchiseptica, Haemophilus spp, Pasteurella spp, Mycoplasma spp. Infecções geniturinárias causadas por Staphylococcus spp, Klebsiella spp, Streptococcus spp, Escherichia coli. Leptospirose: Leptospira spp. Brucelose canina: Brucella canis. Dermatites e otites: Staphylococcus spp, Streptococcus spp, Pasteurella multocida, Fusobacterium spp. Diarreias e gastrenterites causadas por Shigella spp, Escherichia coli, Salmonella spp, Campylobacter jejuni.Tétano: Clostridium tetani.\r\n\r\nNÍVEIS DE GARANTIA DO PRODUTO\r\nCada 100 mL contém :\r\n\r\nDoxiciclina (Hiclato)...................4,6 g*\r\nExcipiente q.s.p....................100,0 mL\r\n\r\n*Equivalente a 4,0 g de Doxiciclina base.\r\n\r\nMODO DE USAR\r\nAdministrar pela via intravenosa ou intramuscular.\r\n\r\nCães: administrar 5 a 10 mg/kg de peso corporal, ou seja, 0,125 a 0,25 mL por kg de peso corporal, uma a duas vezes ao dia, durante 7 a 10 dias. No tratamento da brucelose canina, administrar 10 mg/kg de peso corporal, ou seja, 0,25 mL por kg de peso corporal, uma vez ao dia, durante 14 dias. Recomenda-se que os tratamentos sejam mantidos por 48 horas após o desaparecimento dos sintomas.\r\n\r\nAs dosagens poderão ser alteradas de acordo com a orientação do Médico Veterinário.\r\n\r\nPRECAUÇÕES\r\nInjeções intramusculares podem causar dor no local da aplicação. Injeções intravenosas devem ser administradas lentamente, ou diluídas em solução salina ou outros fluidos livres de cátions polivalentes.\r\n\r\nEm casos de insuficiência renal, as doses podem ser reduzidas de acordo com a orientação do médico veterinário.\r\n\r\nEm cães, doses intramusculares acima de 3 mL devem ser divididas e aplicadas em grupos musculares diferentes.\r\n\r\nEFEITOS COLATERAIS\r\nSistema gastrointestinal: eventualmente, podem ser observados vômitos, náusea e diarréia.\r\n\r\nSistema cardiovascular: a Doxiciclina pode induzir arritmias cardíacas devido à capacidade de ligação ao cálcio plasmático. Reações adversas locais: feblite, reações no local da injeção, dor, inflamação e edema. Reações de natureza alérgica ou anafilática: são raras, mas podem ocorrer em animais sensíveis a Doxiciclina.\r\n\r\nTerapias prolongadas com antibióticos podem proporcionar o desenvolvimento de bactérias e fungos não sensíveis ao princípio ativo.\r\n\r\nCONTRAINDICAÇÕES\r\nNão administrar em fêmeas prenhes e lactantes. A Doxiciclina é contra-indicada em animais que apresentam hepatopatias. Não administrar em animais com menos de um mês de idade, pois ocorre formação de manchas (descoloração) nos dentes dos animais tratados. Esta descoloração está relacionada à quelação dos derivados da tetraciclina aos depósitos de cálcio na dentina do dente em desenvolvimento e, em menor grau, no esmalte. O produto não deve ser utilizado em eqüinos, devido a potenciais riscos de fatalidade dos animais.\r\n\r\nINTERAÇÕES MEDICAMENTOSAS\r\nNão administrar em animais que estejam recebendo tratamento com barbitúricos, fenitoína, penicilinas ou aminoglicosídeos. A Doxiciclina pode aumentar a biodisponibilidade da digoxina, levando a toxicidade desta. A Doxiciclina pode diminuir a atividade da protrombina plasmática, o que requer ajuste de dosagem em pacientes em terapia com anticoagulantes. Não utilizar a Doxiciclina com outras drogas capazes de gerar hepatotoxicidade.\r\n\r\nPERÍODO DE CARÊNCIA\r\nNão usar em animais cujo leite é destinado ao consumo humano.\r\n\r\nNão utilizar a carne de animais tratados para consumo humano antes de decorridos 14 dias da última aplicação.\r\n\r\nCONDIÇÕES DE CONSERVAÇÃO\r\nConservar na embalagem original, em local seco, fresco e ao abrigo da luz solar. Manter fora do alcance de crianças e animais domésticos.\r\n\r\nAPRESENTAÇÕES\r\nFrascos ampola contendo 20 mL.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:30:26', '2017-03-13 22:30:26', 1, '20170313223437.jpg', 0),
(8, 2, 'C', '', 'NexGard - 25,1 kg a 50 kg', 'NexGard - 25,1 kg a 50 kg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'NexGard Cães 25,1 - 50kg é um medicamento de uso oral à base de afoxolaner, indicado para tratamento e prevenção de infestaçõe causadas por pulgas e carrapatos por um período de 30 dias. NexGard é indicado para cães acima de 8 semanas e 2kg de peso.\r\n\r\nNexGard é altamente palatável, facilitando a administração. A rápida absorção de NexGard se inicia em 20 a 30 minutos após a administração. Isso permite que o pico plasmático seja alcançado em apenas 2 a 4 horas.\r\n\r\nNexGard mata totalmente as pulgas em 24 horas e carrapatos em até 48 horas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:32:39', '2017-03-13 22:32:39', 1, '20170313223651.jpg', 0),
(9, 2, 'C', '', 'Bravecto 2 a 4,5 kg - 112,5mg', 'Bravecto 2 a 4,5 kg - 112,5mg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'O Anti Pulgas e Carrapatos Msd Bravecto para Cães de 2 a 4,5kg, é um comprimido mastigável, indicado para o tratamento de infestações por carrapatos e pulgas, em cães, proporcionando 12 semanas de proteção. É um inseticida e acaricida, sistêmico com longa duração de ação, que promove eficácia imediata e persistente por 12 semanas contra carrapatos (formas adultas e jovens de ixodes ricinus, ixodes hexagonus, ixodes holocyclus, dermacentor reticulatus, dermacentor variabilis e rhipicephalus sanguineus) e pulgas (ctenocephalides felis e ctenocephalides canis). Pulgas e carrapatos devem estar aderidos ao cão, e já tendo iniciada a alimentação para serem expostos ao princípio ativo. O início da ação é dentro de 8 horas para pulgas e 12 horas para carrapatos. Bravecto controla eficazmente as populações de pulgas no ambiente, nas áreas às quais o cão tem acesso. Bravecto pode ser utilizado como parte de uma estratégia de tratamento para a dermatite alérgica à picada de pulgas. Bravecto pode ser utilizado em cães reprodutores, fêmeas gestantes ou lactantes. Bravecto foi bem tolerado em cães da raça collie.\r\n\r\nMSD Saúde Animal - Schering: \r\nUma empresa de renome global. Tradicional, tem como metas a pesquisa, o desenvolvimento, produção e comercialização de uma extensa linha de medicamentos e serviços da área veterinária. Seu portfólio é um dos mais inovadores do mercado, envolvendo produtos para a prevenção, tratamento e controle das mais diversas doenças referentes às principais espécies de animais de estimação ou mesmo de pecuária. O maior objetivo da MSD é contribuir para a continuidade do sucesso, desde os seus fornecedores, passando pela distribuição, até o cliente final (os animais) com produtos que façam a diferença. Com a mais alta credibilidade e confiança, a marca vem, cada vez mais, atendendo e conquistando a satisfação de todos, que apreciam seus produtos, serviços e soluções. Tal sucesso, só pode ocorrer caso sejam mantidos o alto padrão, o profissionalismo e a integridade, marcas registradas MSD.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:33:11', '2017-03-13 22:33:31', 1, '20170313223742.jpg', 0),
