(12, 2, 'C', '', 'Bravecto de 20 a 40 kg - 1000mg', 'Bravecto de 20 a 40 kg - 1000mg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'DESCRIÇÃO DO PRODUTO\r\n- Um único comprimido mastigável é eficaz por 12 semanas, quase três vezes mais do que soluções e aplicação mensal;\r\n- Começa a agir a partir de 2 horas matando pulgas e no tratamento do controle de carrapatos;\r\n- Não se preocupe mais com as soluções liquidas que, bagunçam os pelo do seu pet, deixando ele desconfortável;\r\n- Mastigação oral, Tasty seu cão terá como um deleite;\r\n- Diferente de soluções tópicas, não há necessidade de separar o seu pet de outros animais após oferecer o comprimido mastigável de Bravecto.\r\n\r\nDESCRIÇÃO DE ANTI PULGAS E CARRAPATOS BRAVECTO PARA CÃES DE 20 A 40KG - 1000MG\r\nO Anti Pulgas e Carrapatos Msd Bravecto para Cães de 20 a 40kg, é um comprimido mastigável, indicado para o tratamento de infestações por carrapatos e pulgas, em cães, proporcionando 12 semanas de proteção. É um inseticida e acaricida, sistêmico com longa duração de ação, que promove eficácia imediata e persistente por 12 semanas contra carrapatos (formas adultas e jovens de ixodes ricinus, ixodes hexagonus, ixodes holocyclus, dermacentor reticulatus, dermacentor variabilis e rhipicephalus sanguineus) e pulgas (ctenocephalides felis e ctenocephalides canis). Pulgas e carrapatos devem estar aderidos ao cão, e já tendo iniciada a alimentação para serem expostos ao princípio ativo. O início da ação é dentro de 8 horas para pulgas e 12 horas para carrapatos. Bravecto controla eficazmente as populações de pulgas no ambiente, nas áreas às quais o cão tem acesso. Bravecto pode ser utilizado como parte de uma estratégia de tratamento para a dermatite alérgica à picada de pulgas. Bravecto pode ser utilizado em cães reprodutores, fêmeas gestantes ou lactantes. Bravecto foi bem tolerado em cães da raça collie.\r\n\r\nMSD Saúde Animal - Schering: \r\nUma empresa de renome global. Tradicional, tem como metas a pesquisa, o desenvolvimento, produção e comercialização de uma extensa linha de medicamentos e serviços da área veterinária. Seu portfólio é um dos mais inovadores do mercado, envolvendo produtos para a prevenção, tratamento e controle das mais diversas doenças referentes às principais espécies de animais de estimação ou mesmo de pecuária. O maior objetivo da MSD é contribuir para a continuidade do sucesso, desde os seus fornecedores, passando pela distribuição, até o cliente final (os animais) com produtos que façam a diferença. Com a mais alta credibilidade e confiança, a marca vem, cada vez mais, atendendo e conquistando a satisfação de todos, que apreciam seus produtos, serviços e soluções. Tal sucesso, só pode ocorrer caso sejam mantidos o alto padrão, o profissionalismo e a integridade, marcas registradas MSD.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:36:46', '2017-03-13 22:36:46', 1, '20170313224057.jpg', 0),
