(24, 2, 'C', '', 'Frontline Topspot Cães 1 a 10 kilos', 'Frontline Topspot Cães 1 a 10 kilos', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Frontline é o mais indicado para o controle de infestações por pulgas, carrapatos e piolhos em cães e gatos. \r\nUsado periodicamente, é a maneira mais eficaz de quebrar o ciclo das pulgas, evitando a reinfestação ambiental.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:48:51', '2017-03-13 22:48:51', 1, '20170313225303.jpg', 0),
(25, 2, 'C', '', 'NexGard - 2 kilos a 4 kilos', 'NexGard - 2 kilos a 4 kilos', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'NexGard Cães 2 - 4kg é um medicamento de uso oral à base de afoxolaner, indicado para tratamento e prevenção de infestaçõe causadas por pulgas e carrapatos por um período de 30 dias. NexGard é indicado para cães acima de 8 semanas e 2kg de peso.\r\n\r\nNexGard é altamente palatável, facilitando a administração. A rápida absorção de NexGard se inicia em 20 a 30 minutos após a administração. Isso permite que o pico plasmático seja alcançado em apenas 2 a 4 horas.\r\n\r\nNexGard mata totalmente as pulgas em 24 horas e carrapatos em até 48 horas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:52:43', '2017-03-13 22:52:43', 1, '20170313225654.jpg', 0),
(26, 2, 'C', '', 'NexGard - 4,1 kg a 10,0 kg', 'NexGard - 4,1 kg a 10,0 kg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'NexGard Cães 4,1 - 10kg é um medicamento de uso oral à base de afoxolaner, indicado para tratamento e prevenção de infestaçõe causadas por pulgas e carrapatos por um período de 30 dias. NexGard é indicado para cães acima de 8 semanas e 2kg de peso.\r\n\r\nNexGard é altamente palatável, facilitando a administração. A rápida absorção de NexGard se inicia em 20 a 30 minutos após a administração. Isso permite que o pico plasmático seja alcançado em apenas 2 a 4 horas.\r\n\r\nNexGard mata totalmente as pulgas em 24 horas e carrapatos em até 48 horas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:53:43', '2017-03-13 22:53:43', 1, '20170313225754.jpg', 0),
(27, 2, 'C', '', 'NexGard - 10,1 kg a 25 kg', 'NexGard - 10,1 kg a 25 kg', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'NexGard Cães 10,1 - 25kg é um medicamento de uso oral à base de afoxolaner, indicado para tratamento e prevenção de infestaçõe causadas por pulgas e carrapatos por um período de 30 dias. NexGard é indicado para cães acima de 8 semanas e 2kg de peso.\r\n\r\nNexGard é altamente palatável, facilitando a administração. A rápida absorção de NexGard se inicia em 20 a 30 minutos após a administração. Isso permite que o pico plasmático seja alcançado em apenas 2 a 4 horas.\r\n\r\nNexGard mata totalmente as pulgas em 24 horas e carrapatos em até 48 horas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:54:20', '2017-03-13 22:54:20', 1, '20170313225831.jpg', 0),
(28, 2, 'C', '', 'Bactrovet Prata AM', 'Bactrovet Prata AM', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Bactrovet Prata AM é indicado para bovinos de todas as idades, inclusive recém nascidos. Ação larvicida, repelente, cicatrizante e hemostática. É o mata-bicheira mais completo do mercado, com ação prolongada, pois não escorre após a aplicação, aderindo profundamente à lesão e formando uma película protetora que repele as moscas. A válvula multidirecional permite tratar feridas de difícil acesso, pela manobra da embalagem em qualquer direção desejada.\r\n- Larvicida em feridas infestadas, com rápida cicatrização;\r\n- Em feridas acidentais ou cirúrgicas (castração, descorna, cesariana, etc.), elimina o sangramento das mesmas (efeitos adstringente e hemostático), formando uma película protetora que evita a infecção;\r\n- Seu efeito repelente impede que as feridas tratadas sejam atacadas pelas moscas causadoras das miíases;\r\n- Devido à sua alta penetração e persistência é excelente na cura de umbigos;', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:57:16', '2017-03-13 22:57:16', 1, '20170313230127.jpg', 0),
(29, 2, 'C', '', 'Kuraderm Prata', 'Kuraderm Prata', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Kuraderm Prata atua como desinfetante e estimulador de cicatrização.\r\n\r\nÉ um poderoso bactericida, hemostático capilar, cicatrizando rápido de feridas traumáticas, abscessos abertos, úlceras, queimaduras, fraturas expostas, etc.\r\n\r\nTem ótima aderência e dá uma proteção ventilada.\r\n\r\nKuraderm Prata é uma suspensão de sulfadiazina de prata, sulfato de neomicina e alumínio num veículo adesivo emulsionante que dá ao produto uma perfeita aderência, evitando assim o uso de bandagem.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:58:05', '2017-04-02 13:56:33', 1, '20170313230216.jpg', 0),
(30, 2, 'C', '', 'Crema 6A - 15g', 'Crema 6A - 15g', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Ação \r\nCreme Antibiótico, antiinflamatória, antialérgica, antipuriginosa, antifúngicos e Anestésico. \r\n\r\nComposição \r\nAntibióticos: A neomicina e bacitracina combatem eficazmente a totalidade do espectro de bactérias que causam infecções cutâneas. \r\nAntiinflamatória: Dexametasona é um glicocorticóide de ação tópica mais prolongada, já inibe a ação dos fatores de inflamação. \r\nAntialérgica: dexametasona inibe os mediadores locais de reações alérgicas, tais como histamina e leucotrieno C4. \r\nAnestesica: A benzocaína, potente anestésico local, elimina a dor pela interrupção da condução das terminações do nervo periférico. \r\nAntimicotica: griseofulvina atua eficazmente sobre os fungos dos gêneros Microsporum e Trichophytum. \r\nAntipuriginosa A benzocaína (analgésico) e dexametasona (anti) eliminam prurido e desconforto, evitando auto-lesão \r\n\r\nIndicação \r\nTodas as lesões de pele, infectada ou não. \r\nNa otite aguda ou crônica, especialmente em cães. \r\nLesões pruriginosas onde é necessário eliminar a coceira. \r\nTodas as dermatites virais ou não-tuberculosa. \r\nEczema conhecidos ou criptogênica. \r\nPara o veículo, Crema 6A é indicado para tratamento de pelos áreas, pus..., garantindo um detersivo ação e emoliente. \r\nEm cirurgia, especialmente na estética, como corte orelhas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 22:59:35', '2017-04-02 13:54:22', 0, '20170313230346.jpg', 0),
(31, 2, 'C', '', 'Crema 6A', 'Crema 6A', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Ação \r\nCreme Antibiótico, antiinflamatória, antialérgica, antipuriginosa, antifúngicos e Anestésico. \r\n\r\nComposição \r\nAntibióticos: A neomicina e bacitracina combatem eficazmente a totalidade do espectro de bactérias que causam infecções cutâneas. \r\nAntiinflamatória: Dexametasona é um glicocorticóide de ação tópica mais prolongada, já inibe a ação dos fatores de inflamação. \r\nAntialérgica: dexametasona inibe os mediadores locais de reações alérgicas, tais como histamina e leucotrieno C4. \r\nAnestesica: A benzocaína, potente anestésico local, elimina a dor pela interrupção da condução das terminações do nervo periférico. \r\nAntimicotica: griseofulvina atua eficazmente sobre os fungos dos gêneros Microsporum e Trichophytum. \r\nAntipuriginosa A benzocaína (analgésico) e dexametasona (anti) eliminam prurido e desconforto, evitando auto-lesão \r\n\r\nIndicação \r\nTodas as lesões de pele, infectada ou não. \r\nNa otite aguda ou crônica, especialmente em cães. \r\nLesões pruriginosas onde é necessário eliminar a coceira. \r\nTodas as dermatites virais ou não-tuberculosa. \r\nEczema conhecidos ou criptogênica. \r\nPara o veículo, Crema 6A é indicado para tratamento de pelos áreas, pus..., garantindo um detersivo ação e emoliente. \r\nEm cirurgia, especialmente na estética, como corte orelhas.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 23:00:09', '2017-04-02 13:54:44', 1, '20170313230420.jpg', 0),
(32, 2, 'C', '', 'Giardicid Suspensão 50ml', 'Giardicid Suspensão 50ml', 1, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Em caninos:\r\n\r\n\r\nAdministrar por via oral, 25 mg de metronidazol e 25 mg de sulfadimetoxina para cada Kg de peso corporal, a cada 12 horas, durante 5 dias.\r\n\r\n\r\nAs doses bem como a duração do tratamento poderão ser alternados a critério do Médico Veterinário.\r\n\r\n\r\nEm felinos:\r\n\r\n\r\nAdministrar por via oral, 12,5 a 25 mg de metronidazol e 12,5 a 25 mg de sulfadimetoxina para cada Kg de peso corporal, a cada 12 horas, durante 5 dias.\r\n\r\n\r\nAs doses e a duração do tratamento poderão ser alteradas a critério do Médico Veterinário.\r\n\r\n\r\nCONTRA-INDICAÇÕES:\r\n\r\n\r\nO produto é contra-indicado em animais sabidamente hipersensíveis ao metronidazol, à derivados do nitroimidazol ou às sulfonamidas.\r\n\r\n\r\nRecomenda-se não utilizar a droga em animais severamente debilitados, em gestação, em lactação ou recém-nascidos.\r\n\r\n\r\nEFEITOS ADVERSOS:\r\n\r\n\r\nOs efeitos adversos descritos em cães que receberam superdosagens ou em cães hipersensíveis ao metronidazol incluem: desordens neurológicas, letargia, fraqueza, neutropenia, hepatotoxicidade, hematúria, anorexia, náuseas, vômitos e diarréia.\r\n\r\n\r\nA sulfadimetoxina é uma droga segura, porém em caso de tratamento prolongado ou sobredosagem (cerca de 1 g/Kg) poderão ocorrer sialorréia, vômitos, diarréia, hiperpnéia, excitação, miastenia, ataxia e rigidez espástica dos membros.\r\n\r\n\r\nEm casos de intoxicação crônica podem ser observados distúrbios do sistema hematopoiético e agranulocitose transitória.\r\n\r\n\r\nINTERAÇÕES MEDICAMENTOSAS:\r\n\r\n\r\nO metronidazol pode prolongar o tempo de protrombina em pacientes recebendo warfarina ou outros anticoagulantes cumarínicos. Deve ser evitado o uso simultâneo das drogas ou ser intensificado o monitoramento.\r\n\r\n\r\nO fenobarbital e a fenitoína podem aumentar o metabolismo do metronidazol reduzindo os níveis sangüíneos.\r\n\r\n\r\nA cimetidina pode reduzir o metabolismo do metronidazol e aumentar os níveis sangüíneos da droga.\r\n\r\n\r\nPRECAUÇÕES:\r\n\r\n\r\nDeixar sempre água fresca à disposição dos animais tratados.\r\n\r\n\r\nNão tratar animais com hipersensibilidade conhecida aos princípios ativos.\r\n\r\n\r\nUsar com cautela em animais com disfunção hepática ou renal.\r\n\r\n\r\nEm alguns animais de laboratório o metronidazol foi referido como teratogênico mas não há informação sobre esse efeito em cães e gatos. A menos que os riscos aos fetos compensem os benefícios à mãe, deverá ser evitada a utilização durante as 3 primeiras semanas de gestação.', 0, 0, 1, 0, 0, 0, 0, '2017-03-13 23:05:05', '2017-03-13 23:05:05', 1, '20170313230916.jpg', 0),
