(48, 0, 'C', '', 'Prednisolona 5mg', 'Alcort', 0, 0, 0, 0, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Anti-Inflamatório Cepav Alcort 5mg para Cães é indicado para o uso oral em cães. O produto é um anti-inflamatório esteroide indicado em várias condições dermatológicas, alérgicas, oculares, otológicas e musculoesqueléticas, doenças reumáticas, do colágeno, tais como: Condições Dermatológicas: eczema não específico, dermatite solar, queimaduras, etc.', 0, 0, 2, 0, 0, 0, 0, '2017-03-14 15:16:53', '2017-03-14 15:16:53', 1, '', 0),
(49, 2, 'C', '', 'Vetmax Suspensão 5ml', '', 0, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Vetmax Plus Suspensão Oral  é um vermífugo de amplo espectro indicado no combate às infestações por nematódeos (vermes redondos) e cestódeos (vermes chatos) gastrintestinais de cães e gatos. Espectro de ação inclui: Ancylostoma caninum, Ancylostoma tubaeforme, Toxocara canis, Toxocara cati, Toxascaris leonina, Uncinaria stenocephala, Trichuris vulpis, Dipylidium caninum, Echinococcus granulosus, Echinococcus multilocularis, Taenia multiceps, Taenia hydatigena, Taenia pisiformis, Taenia ovis, Mesocestoides spp.\r\nPara animais até 5 kg: 2,5 mL;\r\nde 6 a 10 kg: 5,0 mL;\r\nde 11 a 20 kg: 10 mL;\r\nde 21 a 30 kg: 15 mL;\r\nde 31 a 40 kg: 20 mL.', 0, 0, 2, 0, 0, 0, 0, '2017-03-14 15:20:57', '2017-03-14 15:20:57', 1, '', 0),
(50, 2, 'C', '', 'Giardicid 50ml', '', 0, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, ' É o único medicamento veterinário que trata de forma simultânea os diversos problemas gastroentéricos tais como: Giardíase, Coccidiose, Tricomoníase, Amebíase e as principais infecções intestinais que acometem cães e gatos;', 0, 0, 2, 0, 0, 0, 0, '2017-03-14 15:23:43', '2017-03-14 15:23:43', 1, '', 0),
(51, 0, 'C', '', 'Giardicid 500mg', '', 0, 0, 0, 0, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, ' Para o tratamento de Giardíase, Coccidioses e Infecções intestinais que acometem cães e gatos;\r\n- São revestidos para que não ocorram alterações nas dosagens, assegurando sua absorção e biodisponibilidade;\r\n- Se desfaz rapidamente no estômago, mediante um pH ácido, liberando a Sulfadimetoxina e o Metronidazol, promovendo rápida absorção e distribuição para os órgãos alvos. ', 0, 0, 0, 0, 0, 0, 0, '2017-03-14 15:25:07', '2017-03-14 15:25:07', 1, '', 0),
