(71, 0, 'C', '', 'Acetilcisteína', 'Acetilciteína', 0, 0, 0, 0, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'A acetilcisteína reduz a viscosidade das secreções mucosas, em processos catarrais e gripais, facilitando a expulsão destas secreções.\r\nTratamento antídoto: somente em casos de intoxicação acidental ou voluntária por paracetamol.', 0, 0, 0, 0, 0, 0, 0, '2017-04-02 14:00:20', '2017-04-02 14:00:20', 1, '', 0),
(72, 0, 'C', '', 'Vitamina A', 'Vitamina A', 0, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'A Vitamina A é um micronutriente pertencente ao grupo das vitaminas lipossolúveis, podendo ser encontrada no tecido animal sob a forma de retinóides ou como pró-vitamina em tecidos vegetais, sob a forma de carotenoide. No organismo humano a vitamina A pode ser encontrada de três formas, o retinol, retinal e o ácido retinóico, sendo o último o principal e mais abundante metabólito intracelular em mamíferos', 0, 0, 0, 0, 0, 0, 0, '2017-04-02 14:03:09', '2017-04-02 14:03:47', 1, '', 0),
(73, 0, 'C', '', 'Vetmax Plus (comprimido) 700 mg', 'Vetmax Plus (comprimido) 700 mg', 0, 0, 0, 1, 0, '0.000', '0.000', '0.00', '0.00', '0.00', 0, 0, 'Vetmax Plus Suspensão Oral  é um vermífugo de amplo espectro indicado no combate às infestações por nematódeos (vermes redondos) e cestódeos (vermes chatos) gastrintestinais de cães e gatos. Espectro de ação inclui: Ancylostoma caninum, Ancylostoma tubaeforme, Toxocara canis, Toxocara cati, Toxascaris leonina, Uncinaria stenocephala, Trichuris vulpis, Dipylidium caninum, Echinococcus granulosus, Echinococcus multilocularis, Taenia multiceps, Taenia hydatigena, Taenia pisiformis, Taenia ovis, Mesocestoides spp', 0, 0, 0, 0, 0, 0, 0, '2017-04-02 14:07:28', '2017-04-02 14:07:28', 1, '', 0),
